/*==============================================================*/
/* Table: SYS_NATION_AREA                                       */
/*==============================================================*/
CREATE TABLE SYS_NATION_AREA 
(
   ID_                  VARCHAR2(64)         NOT NULL,
   NATION_              VARCHAR2(10),
   AREA_CODE_           VARCHAR2(20),
   AREA_NAME_           VARCHAR2(100),
   AREA_NAME_PY_        VARCHAR2(200),
   AREA_LEVEL_          SMALLINT,
   PROVINCE_            VARCHAR2(100),
   CITY_                VARCHAR2(100),
   COUNTY_              VARCHAR2(100),
   RANK_                INTEGER,
   STATUS_              SMALLINT,
   PARENT_CODE_         VARCHAR2(64),
   CONSTRAINT PK_SYS_NATION_AREA PRIMARY KEY (ID_)
);

COMMENT ON TABLE SYS_NATION_AREA IS
'地区表';

COMMENT ON COLUMN SYS_NATION_AREA.NATION_ IS
'国家简称';

COMMENT ON COLUMN SYS_NATION_AREA.AREA_CODE_ IS
'地区代码';

COMMENT ON COLUMN SYS_NATION_AREA.AREA_NAME_ IS
'地区名称';

COMMENT ON COLUMN SYS_NATION_AREA.AREA_NAME_PY_ IS
'地区名称拼音';

COMMENT ON COLUMN SYS_NATION_AREA.AREA_LEVEL_ IS
'地区级别';

COMMENT ON COLUMN SYS_NATION_AREA.PROVINCE_ IS
'省份';

COMMENT ON COLUMN SYS_NATION_AREA.CITY_ IS
'城市';

COMMENT ON COLUMN SYS_NATION_AREA.COUNTY_ IS
'县级';

COMMENT ON COLUMN SYS_NATION_AREA.RANK_ IS
'排序，值越大越前';

COMMENT ON COLUMN SYS_NATION_AREA.STATUS_ IS
'状态，[1:显示, 2:隐藏]';

COMMENT ON COLUMN SYS_NATION_AREA.PARENT_CODE_ IS
'所属地区';


